import React, { memo } from "react";

import { HotRecommendWrapper } from "./style";
import HYThemeHeaderRCM from "@/components/theme-header-rcm";

export default memo(function LJHotRecommend() {
  return (
    <div>
      <HotRecommendWrapper>
        <h2>22</h2>
        <LJThemeHeaderRCM></LJThemeHeaderRCM>
      </HotRecommendWrapper>
    </div>
  );
});
